import React from 'react';

export const TextInput = ({ ...props }) => {
  return (
    <div className='flex flex-col w-[100%] py-2'>
      <div className='text-[16px]  font-roboto w-full'>{props?.label}</div>
      <div>
        <input
          type={props?.type || 'text'}
          className='p-2 w-full appearance-none border border-[#E5E5E5] rounded-md text-[16px] font-roboto'
          value={props?.value}
          onInput={props?.onChange}
        />
      </div>
    </div>
  );
};
